import { useParams } from 'react-router-dom';
const NotePage = ({match}) => {
    const { id } = useParams()
    let noteId = id
    let [note, setNote] = useState(null)
    return(
        <div>
            <h3>Single Note</h3>
            <h4>Note id: {noteId}</h4>
        </div>
    )
}

export default NotePage
